// TenPercentServiceFeeCalculator.js
import ServiceFeeCalculator from './ServiceFeeCalculator';

class TenPercentServiceFeeCalculator extends ServiceFeeCalculator {
    calculate(price) {
        return price * 0.1; // 10% of the price
    }
}

export default TenPercentServiceFeeCalculator;
